 <style include="iron-flex"></style>
   <style is="custom-style">

paper-card { max-width: 300px; min-width: 250px; margin: 10px; }

    app-toolbar {
      font-size: 18px;
      font-weight: 400;
      letter-spacing: 5px;
      text-align: center;
      color: #1a237e;
    }

    .nav {
      height: 64px;
      margin: 0;
      padding: 0;
      text-align: center;
      background-color: rgba(255, 255, 255, 0.8);
    }

    .nav li {
      display: inline-block;
      list-style: none;
    }

    .nav a {
      display: inline-block;
      font-weight: 12px;
      line-height: 64px;
      text-decoration: none;
      color: black;
      font-weight: 300;
      margin: 0 10px;
    }

    .nav a:hover {
      color: #444;
      border-bottom: 1px solid #999;
    }

    [threshold-triggered] {
      position: fixed;
      top: 0;
      left: 0;
      right: 0;
      z-index: 1;
      -webkit-backdrop-filter: saturate(180%) blur(20px);
      backdrop-filter: saturate(180%) blur(20px);
    }

    .first, .second, .third {
      height: 600px;
    }
    .fourth{
      height: 300px;
    }

    .first {
      --app-box-background-front-layer: {

        background-position: bottom;
        padding-bottom: 120px;
        margin-top: -20px;
        height: 100%;
      };
    }
    .second {
      --app-box-background-front-layer: {
        background-image: url(images/products.png);
        background-position: bottom;
        padding-bottom: 120px;
        margin-top: -20px;
        height: 100%;
      };
    }

    .third {
      --app-box-background-front-layer: {
        background-image: url(images/cases.png);
        background-position: bottom;
        padding-bottom: 120px;
        margin-top: -20px;
        height: 100%;
      };
    }

    .fourth {
      --app-box-background-front-layer: {

        background-position: bottom;
        padding-bottom: 120px;
        margin-top: -20px;
        height: 100%;

      };
    }

    section {
      padding-top: 100px;
    }

    article {
      font-weight: 100;
      max-width: 500px;
      text-align: center;
      margin: 0 auto 100px auto;
    }
    article h2 {
      font-weight: 100;
      font-size: 50px;
      margin: 5px;
      line-height: 110%
    }
    article h3 {
      font-weight: 80;
      font-size: 30px;
      margin: 10px;
    }

    article p {
      font-size: 18px;
      line-height: 30px;
    }

    article p-mini {
      font-size: 10px;
      line-height: 30px;
    }

    article hr {
      width: 100px;
      height: 1px;
      border: none;
      margin: 20px auto;
      background-color: black;
    }
    .flex-horizontal-with-ratios {
      @apply(--layout-horizontal);
    }

    .flex2child {
      @apply(--layout-flex-2);
      background-color: #E8F8F5;
    }
    .flex10child {
      @apply(--layout-flex-10);

    }

    .uengine-products-div{
      margin: 0;
      font-family: 'Roboto', 'Noto', sans-serif;
      background-color: #fafafa;
      position: fixed;
    }

    .red{
      color: red;
    }
    .red-background{
      color: #ffffff;
      background-color: red;
    }
    .orange{
      color: #FFC300;
    }
    .orange-background{
      color: #ffffff;
      background-color: #FFC300;
    }
    .cobalt-blue{
      color: #00039c;
    }
    .cobalt-blue-background{
      color: #ffffff;
      background-color: #00039c;
    }
    .green{
      color: #58D68D;
    }
    .green-background{
      color: #ffffff;
      background-color: #58D68D;
    }
    .brown{
      color: #967f61;
    }
    .brown-background{
      color: #ffffff;
      background-color: #967f61;
    }
    .right-menu-color{
       background-color: #E8F8F5;
       color: #ffffff;
    }
    .white{
      color: #ffffff;
    }



  </style>

<paper-card heading="Beluga PaaS Engine" i="" mage="http://placehold.it/350x150/FFC107/000000" alt="Emmental">
  <div class="card-content">
    도커와 메소스를 응용한 트위터에서 검증된 그리드엔진을 기반한 PaaS. 도커가 제공하는 다양한 어플리케이션 구동 환경을 지원. 애플리케이션 소스코드에서 도커이미지를 생성시킨 후 서비스를 구동 시킨 후 장애 발생시 오토페일오버(Auto-Failover), 오토스케일(Auto-Scale), 무정지재배포를 목표로 함.
    <br><br>
     <p align="right">Developed and Supported by 지앤클라우드, 유엔진<br>Serviced by 엔키소프트 </p>
  </div>
  <div class="card-actions">
    <paper-button>Share</paper-button>
    <paper-button><a href="http://github.com/TheOpenCloudEngine/beluga">Explore!</a></paper-button>
  </div>
</paper-card>


<paper-card heading="OCE-IAM / GW" i="" mage="http://placehold.it/350x150/FFC107/000000" alt="Emmental">
  <div class="card-content">
    사용자 인증을 한번한 후 JWT 토큰을 발행함. 발행한 토큰은 여러개의 분산된 마이크로서비스들을 넘나들어 서비스와 데이터를 조합하여야 하는 AJAX 웹 클라이언트 구현에 적합함. OCE-GW와 함께 인증처리를 수행하여 원천 마이크로서비스들을 인증형태 서비스로 빠르게 포장시킬 수 있음.
    <br><br>
     <p align="right">Developed and Supported by 유엔진 </p>
  </div>
  <div class="card-actions">
    <paper-button>Share</paper-button>
    <paper-button><a href="http://github.com/TheOpenCloudEngine/OCE-IAM">Explore!</a></paper-button>
  </div>
</paper-card>


<paper-card heading="OCE-Billing" alt="Emmental">
  <div class="card-content">
    그루폰이 사용하는 빌링엔진인 KillBill을 사용하여 만든 빌링/미터링 도구. 킬빌엔진을 그냥 사용시 API와 어려운 UI를 통하여 관리하던 것을, 웹기반 플랜 모델러, 인보이스 폼 생성기, 통계 분석 도구등의 UI를 제공함. 또한 동적 카탈로그, 마켓플레이스 구축을 위한 플러그인 과금 모델 등의 확장 작업을 수행한 결과. OCE-IAM/GW 와 연동되어 통합적으로 적용시 별도 미터링을 구성하지 않아도 테넌트를 바로 식별, 사용량을 측정하고 인보이스를 발행하는 통합 오퍼레이션이 가능함. 국내 다양한 서비스에 적용중.
    <br><br>
     <p align="right">Developed and Supported by 유엔진 </p>
  </div>
  <div class="card-actions">
    <paper-button>Share</paper-button>
    <paper-button><a href="http://github.com/TheOpenCloudEngine/beluga">Explore!</a></paper-button>
  </div>
</paper-card>

<paper-card heading="metaworks" i="" mage="http://placehold.it/350x150/FFC107/000000" alt="Emmental">
  <div class="card-content">
    자바클래스의 메타데이터를 추출하여 애플리케이션의 폼, 그리드 등을 생성. 생성 타겟은 Html5+jQuery, Polymer, Vue.js (계획) 가 대상. 멀티테넌시 애플리케이션의 객체관리를 통한 테넌트별 설정된 객체의 추가속성에 반응하는 UI, 그리드 처리를 가능케함. POJO 프레임워크이기 때문에 Spring, JPA와 혼합하여 사용시, 테넌트별 SQL처리, 데이터 접근 처리를 할 수 있음. 샘플애플리케이션인 <a href="http://github.com/TheOpenCloudEngine/micro-service-architecture">마이크로서비스아키텍처</a> 를 참고
    <br><br>
     <p align="right">Developed and Supported by 유엔진 </p>
  </div>
